import './Todo.css'
import Concepts from "./Concepts";
function Todo(props){

    return(
        <div>
            <ul id="concepts">
                <Concepts concepts={props.concepts[0].image}/>
                <Concepts concepts={props.concepts[1]}/>
                <Concepts concepts={props.concepts}/>

            </ul>
        </div>
    )
}

export default Todo;
